import logo from './logo.svg';
import './App.css';
import SignUpPage from './pages/SignInPage';
import ChooseRolePage from './pages/ChooseRolePage';
import QuestionnairePage from './pages/QuestionnairePage';
import HomePage from './pages/HomePage';
import LandingPage from './pages/LandingPage';
import ProcessCompletionPage from './pages/ProcessCompletionPage';
import * as Constants from './Constants';
import {
  BrowserRouter
  ,Link
  ,Routes
  ,Route
  // ,createRoutesFromElements
  // ,createBrowserRouter
} from 'react-router-dom'
import DataBase from './data/DataBase';
import { useContext, useState } from 'react';
import { UserRole } from './context/UserRole';
import SignUpFlow from './pages/SignUpFlow';


function addSemi(string){
    return('/' + string)
}

function App() {
  const data = new DataBase()

  return (
    <>
    {/* <h1> { role } </h1>
    <button onClick={() => setRole(200)}> setRole </button> */}

    <BrowserRouter>
        <Routes>
            <UserRole.Provider value={{role, setRole}}>
                <Route path= {Constants.CHOOSE_ROLE_PAGE}
                        action={({ props }) => {}}
                        element = {
                            <ChooseRolePage />
                        }
                        exact
                        />;
                <Route path={Constants.REG_FORM}
                    action={({ props }) => {}}
                    element = {<QuestionnairePage />}
                    exact
                    />;
            </UserRole.Provider>



            <Route path={Constants.LANDING_PAGE}
                action={({ params }) => {}}
                element = {<LandingPage />}
                exact
                />;
            <Route path={Constants.SIGN_IN}
                action={({ params }) => {}}
                element = {<SignUpPage />}
                exact
                />;
            <Route path={Constants.HOME_PAGE}
                action={({ params }) => {}}
                element = {<HomePage user={data.findByName('Nits')}/>}
                exact
                />;
            <Route path={Constants.PROCESS_COMPLETION_FORM}
                action={({ params }) => {}}
                element = {<ProcessCompletionPage user={data.findByName('Nits')}/>}
                exact
                />;
        </Routes>

    </ BrowserRouter>
    {/* </UserRole.Provider> */}

    </>
  );
}

export default App;
